import React from "react";

import classes from "./ProfileImageInfo.module.css";



const ProfileImageInfo = (props) =>{





return (

<div className={classes.profileImageInfo}>


                 <div className={classes.nameDiv}>
                                           <i className={classes.name_i}><h2> Mr. {props.data.firstname}   {props.data.lastname}</h2> </i>
                 </div>
                 <div className={classes.profileImageInfo_position}>  Standard: <i>12th</i> </div>
                 <div className={classes.profileImageInfo_joiningDate}> Joined: <i>17th Oct 2021 </i> </div>
                 <div className={classes.profileImageInfo_status}> Status: <i>active</i>  </div>








</div>
);

}

export default ProfileImageInfo;
